import styled from '@emotion/styled';

const Outline = styled.div`
  border: 1px solid;
  margin-bottom: 40px;
`;

const Img = styled.img`
  max-width: 100%;
  height: auto;
`;

const Wrapper = styled.div({
  display: 'grid',
  [p]: {
    color: 'red',
    //   grid-column: 2 / 4;
    //   grid-row: 1 / 3;
  },
});

export const Card = {
  Outline,
  Img,
  Wrapper,
};

export default Card;
